import React, { useState } from "react";
import { predict } from "../api/predict";

const InputForm = ({ onResult }) => {
  const [formData, setFormData] = useState({
    Age: "",
    Gender: "",
    Study_Hours_per_Week: "",
    Preferred_Learning_Style: "",
    Online_Courses_Completed: "",
    Participation_in_Discussions: "",
    Assignment_Completion_Rate: "",
    Exam_Score: "",
    Attendance_Rate: "",
    Use_of_Educational_Tech: "",
    Self_Reported_Stress_Level: "",
    Time_Spent_on_Social_Media: "",
    Sleep_Hours_per_Night: ""
  });

  // Handle input changes
  const handleChange = (e) => {
    setFormData({ 
        ...formData, 
        [e.target.name]: e.target.value 
    });
  };

  // Handle form submit
  const handleSubmit = async (e) => {
    e.preventDefault();

    const formattedData = {
      Age: Number(formData.Age),
      Gender: formData.Gender,
      Study_Hours_per_Week: Number(formData.Study_Hours_per_Week),
      Preferred_Learning_Style: formData.Preferred_Learning_Style,
      Online_Courses_Completed: Number(formData.Online_Courses_Completed),
      Participation_in_Discussions: formData.Participation_in_Discussions,
      Assignment_Completion_Rate: Number(formData.Assignment_Completion_Rate),
      Exam_Score: Number(formData.Exam_Score),
      Attendance_Rate: Number(formData.Attendance_Rate),
      Use_of_Educational_Tech: formData.Use_of_Educational_Tech,
      Self_Reported_Stress_Level: formData.Self_Reported_Stress_Level,
      Time_Spent_on_Social_Media: Number(formData.Time_Spent_on_Social_Media),
      Sleep_Hours_per_Night: Number(formData.Sleep_Hours_per_Night),
    };

    const result = await predict(formattedData);
    onResult(result);
  };

  return (
    <form className="input-form" onSubmit={handleSubmit}>
      <h2>Student Performance Prediction</h2>

      {/* Age */}
      <label>Age:</label>
      <input type="number" name="Age" value={formData.Age} onChange={handleChange} required />

      {/* Gender */}
      <label>Gender:</label>
      <select name="Gender" value={formData.Gender} onChange={handleChange} required>
        <option value="">Select</option>
        <option value="Male">Male</option>
        <option value="Female">Female</option>
        <option value="Other">Other</option>
      </select>

      {/* Study Hours */}
      <label>Study Hours per Week:</label>
      <input
        type="number"
        name="Study_Hours_per_Week"
        value={formData.Study_Hours_per_Week}
        onChange={handleChange}
        required
      />

      {/* Learning Style */}
      <label>Preferred Learning Style:</label>
      <select
        name="Preferred_Learning_Style"
        value={formData.Preferred_Learning_Style}
        onChange={handleChange}
        required
      >
        <option value="">Select</option>
        <option value="Visual">Visual</option>
        <option value="Auditory">Auditory</option>
        <option value="Reading/Writing">Reading/Writing</option>
        <option value="Kinesthetic">Kinesthetic</option>
      </select>

      {/* Online Courses */}
      <label>Online Courses Completed:</label>
      <input
        type="number"
        name="Online_Courses_Completed"
        value={formData.Online_Courses_Completed}
        onChange={handleChange}
        required
      />

      {/* Participation */}
      <label>Participation in Discussions:</label>
      <select
        name="Participation_in_Discussions"
        value={formData.Participation_in_Discussions}
        onChange={handleChange}
        required
      >
        <option value="">Select</option>
        <option value="High">Yes</option>
        <option value="Medium">Medium</option>
        <option value="Low">Low</option>
      </select>

      {/* Assignment Completion */}
      <label>Assignment Completion Rate (%):</label>
      <input
        type="number"
        name="Assignment_Completion_Rate"
        value={formData.Assignment_Completion_Rate}
        onChange={handleChange}
        required
      />

      {/* Exam Score */}
      <label>Exam Score (%):</label>
      <input
        type="number"
        name="Exam_Score"
        value={formData.Exam_Score}
        onChange={handleChange}
        required
      />

      {/* Attendance */}
      <label>Attendance Rate (%):</label>
      <input
        type="number"
        name="Attendance_Rate"
        value={formData.Attendance_Rate}
        onChange={handleChange}
        required
      />

      {/* Tech Usage */}
      <label>Use of Educational Tech:</label>
      <select
        name="Use_of_Educational_Tech"
        value={formData.Use_of_Educational_Tech}
        onChange={handleChange}
        required
      >
        <option value="">Select</option>
        <option value="High">High</option>
        <option value="Medium">Medium</option>
        <option value="Low">Low</option>
      </select>

      {/* Stress */}
      <label>Self Reported Stress Level:</label>
      <select
        name="Self_Reported_Stress_Level"
        value={formData.Self_Reported_Stress_Level}
        onChange={handleChange}
        required
      >
        <option value="">Select</option>
        <option value="High">High</option>
        <option value="Medium">Medium</option>
        <option value="Low">Low</option>
      </select>

      {/* Social Media */}
      <label>Time Spent on Social Media (hours/week):</label>
      <input
        type="number"
        name="Time_Spent_on_Social_Media"
        value={formData.Time_Spent_on_Social_Media}
        onChange={handleChange}
        required
      />

      {/* Sleep */}
      <label>Sleep Hours per Night:</label>
      <input
        type="number"
        name="Sleep_Hours_per_Night"
        value={formData.Sleep_Hours_per_Night}
        onChange={handleChange}
        required
      />

      <button type="submit">Predict</button>
    </form>
  );
};

export default InputForm;
